import "./style.css";

const Footer = () => {
  return (
    <footer>

      <a
        href="https://www.linkedin.com/in/prakhar-goel-40a86b19b/"
        target="_blank"
      >
        <img
          src="https://github.com/DwinaTech/public-images/blob/main/linkedin-icon.png?raw=true"
          alt="LinkIn-icon"
        />
      </a>

    </footer>
  );
};

export default Footer;
